    post:
      description: Create a new Salesforce Case
      parameters:
      - description: 'The subject of the case. Limit: 255 characters.'
        example: ''
        in: query
        name: Subject
        required: true
        schema: {type: string}
      - description: The company name that was entered when the case was created.
          This field can't be updated after the case has been created. Label is Company.
        example: ''
        in: query
        name: Supplied Company
        required: false
        schema: {type: string}
      - description: 'A text description of the case. Limit: 32 KB.'
        example: ''
        in: query
        name: Description
        required: false
        schema: {type: string}
      - description: The importance or urgency of the case, such as High, Medium,
          or Low.
        example: High
        in: query
        name: Priority
        required: false
        schema: {type: string}
      - description: ID of the contact who owns the case.
        example: 0054T000000LLnUQAW
        in: query
        name: Owner ID
        required: false
        schema: {type: string}
      - description: The type of case, such as Feature Request or Question.
        example: Feature Request
        in: query
        name: Type
        required: false
        schema: {type: string}
      - description: The status of the case, such as New, Closed, or Escalated. This
          field directly controls the IsClosed flag. Each predefined Status value
          implies an IsClosed flag value.
        example: New
        in: query
        name: Status
        required: false
        schema: {type: string}
      - description: Indicates whether the case has been escalated (true) or not.
          A case's escalated state does not affect how you can use a case, or whether
          you can query, delete, or update it. You can set this flag via the API.
          Label is Escalated.
        example: ''
        in: body
        name: Is Escalated
        required: false
        schema: {type: string}
      - description: The phone number that was entered when the case was created.
        example: (111) 111-1111
        in: query
        name: Supplied Phone
        required: false
        schema: {type: string}
      - description: ID of the associated Contact.
        example: 0054T000000LLnUQAW
        in: query
        name: Contact ID
        required: false
        schema: {type: string}
      - description: The reason why the case was created, such as Instructions not
          clear, or User didn't attend training.
        example: ''
        in: query
        name: Reason
        required: false
        schema: {type: string}
      - description: The name that was entered when the case was created. This field
          can't be updated after the case has been created. Label is Name.
        example: ''
        in: query
        name: Supplied Name
        required: false
        schema: {type: string}
      - description: The email address that was entered when the case was created.
          If your organization has an active auto-response rule, SuppliedEmail is
          required when creating a case via the API. Auto-response rules use the email
          in the contact specified by ContactId. If no email address is in the contact
          record, the email specified here is used.
        example: ''
        in: query
        name: Supplied Email
        required: false
        schema: {type: string}
      - description: ID of the account associated with this case.
        example: 0054T000000LLnUQAW
        in: query
        name: Account ID
        required: false
        schema: {type: string}
      - description: The ID of the parent case in the hierarchy. The label is Parent
          Case.
        example: 0054T000000LLnUQAW
        in: query
        name: Parent ID
        required: false
        schema: {type: string}
      - description: The source of the case, such as Email, Phone, or Web. Label is
          Case Origin.
        example: Phone
        in: query
        name: Origin
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
