        example: 0054T000000LLnUQAW
        in: query
        name: Owner ID
        required: false
        schema: {type: string}
      - description: The type of case, such as Feature Request or Question.
        example: Feature Request
        in: query
        name: Type
        required: false
        schema: {type: string}
